import React, { Component } from 'react'
import { NavBar, Icon, Carousel , SearchBar, Button, WhiteSpace, WingBlank} from 'antd-mobile';

export default class Shop extends Component {
    render() {
        return (
            <div>
                <NavBar style={{backgroundColor:'#3fcccb',color:'white'}}
                rightContent={[
                    <Icon key='0' type='search' />
                ]}
                >商城</NavBar>
                {/* <WingBlank><div className="sub-title"></div></WingBlank> */}
                <SearchBar placeholder="输入关键字搜索" maxLength={8} />
                <WhiteSpace />
            </div>
        )
    }
}
